import React from 'react';
import wall from './wall.svg';
const Home =() => {
	return ( 
		<>
		
			<div class="wallpaper">
			<img src={wall} alt="Responsive image" width='100%' class="img-fluid" />
		</div>
		<div class="container">
		     <div class="row">
		            <div class="col-8 col-sm-6"><h1>This is Homepage</h1></div>
		      </div>
		</div>
		
		
			
		</>
		);
};

export default Home;
